import React from "react";
import "./filter.css";

const Filter = () => {
  return (
    <div id="filter-container">
      <div className="row">
        <div className="skills-container col-sm-12">
          <span>Cooking</span>
        </div>
      </div>
    </div>
  );
};

export default Filter;
